	module.exports = "<h1 id=\"-\">组件基类</h1>\n<p>所有的业务要继承BaseComponent，BaseComponent封装了一些公共处理</p>\n<h2 id=\"-\">功能</h2>\n<h3 id=\"-\">获取当前登录用户</h3>\n<pre><code>this.currentUser;\n</code></pre><h3 id=\"-\">当前用户权限检测</h3>\n<pre><code>this.currentUser.hasPermission(&#39;user-update&#39;);\n</code></pre><h3 id=\"-loading\">全屏loading</h3>\n<pre><code>this.startLoading();\nthis.endLoading();\n</code></pre><h3 id=\"request-\">request封装，链式调用</h3>\n<ol>\n<li>自动startLoading,endLoading</li>\n<li>自动处理异常：服务端返回异常，断网异常，超时异常</li>\n<li>自动根据约定处理返回结果</li>\n</ol>\n<pre><code>this.request()\n.get(url)\n.timeout(1000*10) // 设置超时时间，默认是10秒\n.params({}) // 内部会区分，get请求使用query，post，put，del请求使用send\n.noLoading() // 不会调用全屏loading，如果需要自己处理loading，会用到此函数\n.setErrorMsg(errorMsg) // 自定义错误提示信息，否则内部会自动尝试给出错误提示\n.start(cb) // ajax开始之间的回调函数 cb:function()\n.error(cb) // 出错时回调函数 cb:functin(err, res)\n.success(cb) // 成功回调，尝试根据约定处理结果（result results约定），如果结果不是自己想要的，可以从res中获取，cb:function(result || results || res.body || res, res)\n.end(cb) // 以上方法只是在做准备，end函数才真正根据前面得准备发送请求。所以一定要调用end。cb可选，cb:function(err, res)\n</code></pre><h3 id=\"-\">组件卸载，自动打断未结束请求</h3>\n<pre><code>componentWillUnmount() {\n        // 组件卸载之后，打断所有未结束得请求，\n        // 子类要是要使用componentWillUnmount，需要显示的调用super().componentWillUnmount();\n        this.requests.forEach(r =&gt; {\n            r.abort();\n        });\n    }\n</code></pre>";

